import React from 'react';
import { motion } from 'framer-motion';
import {
  LayoutDashboard, Users, MessageCircle, Settings,
  Building2, BarChart3, Shield, Zap, ChevronLeft,
  ChevronRight, Sparkles, ExternalLink
} from 'lucide-react';
import useStore from '../../store/useStore';
import { AI_ASSISTANT_URL } from '../../utils/constants';
import './Sidebar.css';

const menuItems = [
  { id: 'dashboard', icon: LayoutDashboard, label: 'דשבורד', labelEn: 'Dashboard' },
  { id: 'crm', icon: Users, label: 'לידים', labelEn: 'Leads CRM' },
  { id: 'rooms', icon: Building2, label: 'חדרים', labelEn: 'Rooms' },
  { id: 'analytics', icon: BarChart3, label: 'אנליטיקס', labelEn: 'Analytics' },
  { id: 'agents', icon: Zap, label: 'סוכנים', labelEn: 'Agents' },
  { id: 'settings', icon: Settings, label: 'הגדרות', labelEn: 'Settings' },
];

const Sidebar = ({ activeView, setActiveView }) => {
  const { sidebarOpen, toggleSidebar, lang } = useStore();
  const isRTL = lang === 'he';

  const handleAIAssistantClick = () => {
    window.open(AI_ASSISTANT_URL, '_blank', 'noopener,noreferrer');
  };

  return (
    <motion.aside
      initial={false}
      animate={{ width: sidebarOpen ? 260 : 80 }}
      className={`sidebar glass-dark ${sidebarOpen ? 'open' : 'collapsed'}`}
    >
      {/* Logo */}
      <div className="sidebar-logo">
        <div className="logo-icon">
          <Building2 size={28} />
        </div>
        <motion.span
          initial={false}
          animate={{ opacity: sidebarOpen ? 1 : 0, width: sidebarOpen ? 'auto' : 0 }}
          className="logo-text"
        >
          LuxuryStay
        </motion.span>
      </div>

      {/* Navigation */}
      <nav className="sidebar-nav">
        {menuItems.map((item) => (
          <motion.button
            key={item.id}
            whileHover={{ x: isRTL ? -4 : 4 }}
            whileTap={{ scale: 0.98 }}
            onClick={() => setActiveView(item.id)}
            className={`nav-item ${activeView === item.id ? 'active' : ''}`}
          >
            <item.icon size={22} />
            <motion.span
              initial={false}
              animate={{ opacity: sidebarOpen ? 1 : 0, width: sidebarOpen ? 'auto' : 0 }}
              className="nav-label"
            >
              {isRTL ? item.label : item.labelEn}
            </motion.span>
            {activeView === item.id && (
              <motion.div
                layoutId="activeIndicator"
                className="active-indicator"
              />
            )}
          </motion.button>
        ))}
      </nav>

      {/* AI Assistant Button */}
      <div className="sidebar-action">
        <motion.button
          whileHover={{ scale: 1.02 }}
          whileTap={{ scale: 0.98 }}
          onClick={handleAIAssistantClick}
          className="ai-assistant-sidebar-btn"
        >
          <Sparkles size={20} />
          <motion.span
            initial={false}
            animate={{ opacity: sidebarOpen ? 1 : 0, width: sidebarOpen ? 'auto' : 0 }}
          >
            AI Assistant
          </motion.span>
          {sidebarOpen && <ExternalLink size={14} />}
        </motion.button>
      </div>

      {/* Toggle Button */}
      <motion.button
        whileHover={{ scale: 1.1 }}
        whileTap={{ scale: 0.9 }}
        onClick={toggleSidebar}
        className="sidebar-toggle"
      >
        {sidebarOpen ? (
          isRTL ? <ChevronRight size={18} /> : <ChevronLeft size={18} />
        ) : (
          isRTL ? <ChevronLeft size={18} /> : <ChevronRight size={18} />
        )}
      </motion.button>

      {/* Security Badge */}
      <div className="sidebar-footer">
        <div className="security-badge">
          <Shield size={16} />
          <motion.span
            initial={false}
            animate={{ opacity: sidebarOpen ? 1 : 0, width: sidebarOpen ? 'auto' : 0 }}
          >
            Zero-Trust Secured
          </motion.span>
        </div>
      </div>
    </motion.aside>
  );
};

export default Sidebar;
